import React, { Component } from 'react';
import ResultsAPI from "../../API/ResultsAPI";
import F1InfoAPI from "../../API/InfoAPI";

class RecentResults extends Component<any,any> {
    constructor(props: any) {
        super(props);
        this.state = {
            recentinfo: [],
        };
    }

    async componentDidMount() {
        const resultApi: ResultsAPI = new ResultsAPI()
        const recentinfo: any[] = await resultApi.Recent();
        this.setState({ recentinfo });
        console.log("Recent Info:", recentinfo);
    }

    render() {
        var ready: boolean = false
        var info: any = [];
        setTimeout(()=>{
            const {recentinfo} = this.state
            info = recentinfo
            ready = true
            console.log(info)
            console.log("in timeout")
        }, 1000)
        console.log("ready", ready)
        return ready ? (
            <div className={"flex flex-raw justify-center h-[50%] w-[70%] p-10 "}>
                <h1>{info[info.length - 1].location}</h1>
                <h2>{info[info.length - 1].date}</h2>
                <h2>{info[info.length - 1].time}</h2>
                <h2>{info[info.length - 1].season}</h2>
                {info.slice(0, info.length - 1).map((elem: any, key:number)=>(
                    <div key={key}>
                        {elem.number}
                        {elem.constructor}
                        {elem.driver}
                        {elem.points}
                        {elem.position}
                        {elem.status}
                    </div>
                ))}
            </div>
        ): <p>LOADING..</p>
    }
}

export default RecentResults;
